import React  from "react";

import './homepage.css'

const Homepage = (props) => {
  let navi = useNavigate();
  return (
    <div className="homepage-main">
      <button className="predict-button"  onClick={()=>navi("/")}>{props.title}</button >
    </div>
  )
}

export default Homepage
